import Vue from 'vue'
import Router from 'vue-router'
import Mock from 'mockjs'

Vue.use(Router)

const router = new Router({
  routes: [
    {
      path: '/',
      name: 'App',
      component: resolve => require([`@src/App.vue`], resolve)
    },
    {
      path: '/login',
      name: 'Login',
      component: resolve => require([`@src/Login.vue`], resolve)
    },
    {
      path: '/layout',
      name: 'Layout',
      component: resolve => require([`@src/components/theme/${kindo.config.SYSTEM_THEME}/Layout.vue`], resolve)
    },
    {
      path: '/changeLog',
      name: 'ChangeLog',
      component: resolve => require([`@src/ChangeLog.vue`], resolve)
    }
  ]
})

router.beforeEach((to, from, next) => {
  // 除 login 外, 其他所有路由都需要进行登录验证
  if (to.fullPath === '/login') {
    // 登录验证

    return next()
  }

  // 引入mock
  if (to.meta.path) {
    try {
      let config = require(`../${to.meta.path}/config/index.js`)
      if (config && config.default && config.default.mock) {
        for (var key in config.default.mock) {
          if (config.default.mock.hasOwnProperty(key)) {
            Mock.mock(new RegExp(config.default.api[key] + '*'), config.default.mock[key])
          }
        }
      }
    } catch (error) {
      // kindo.util.alert('引入mock 出错', undefined, 'error')
    }
  }

  next()
})

export default router



